import React, { useState, useEffect } from "react";
import { getMyAppointments } from "./apiService"; // your API file

function MyAppointment() {
  const [appointments, setAppointments] = useState([]); // ✅ clear name

  useEffect(() => {
    const fetchAppointments = async () => {
      const data = await getMyAppointments();
      setAppointments(data.appointments || []); // ensure it's an array
    };
    fetchAppointments();
  }, []);

  return (
    <div>
      <h2>My Appointments</h2>
      {appointments.map((item) => (
        <div key={item.id}>
          {item.name} - {item.date}
        </div>
      ))}
    </div>
  );
}

export default MyAppointment;
